import React, { Component } from "react";
import CvEdExpForm from "./CvEdExpForm";

class CvEdExpRender extends CvEdExpForm {
    constructor(props) {
        super(props);
        this.state = {...this.state, coca: "lol"}
    }


    render() {
        return (
            console.log(this.state)
        )
    }
}

export default CvEdExpRender;
